{"query":"query GetAllJiraInterfaces {
  queryInterface(filter: {path: {regexp: "/cap.interface.productivity.jira.*/"}}) {
    path
    prefix
    name
    revisions {
      implementedBy {
        id
        metadata {
          path
        }
      }
      revision
      id
    }
  }
}

","operationName":"GetAllJiraInterfaces"}

{"query":"query GetInstallInterfaceInSpecificRevision {
  getInterface(path: "cap.interface.productivity.jira.install") {
    name
    prefix
    path
    revisions(filter: { revision: {eq: "0.3.1"}}) {
      id
      metadata {
        path
      }
      revision
      implementedBy {
        metadata {
          path
        }
      }
    }
    latestRevision {
      id
      revision
      metadata {
        id
        path
      }
      implementedBy {
        revision
        metadata {
          path
        }

      }
    }
  }
}","operationName":"GetInstallInterfaceInSpecificRevision"}

{"query":"query GetAtlassianImpl {
  queryImplementation(filter: {path: {regexp: "/cap.implementation.atlassian.*/"}}) {
    path
    prefix
    name
    revisions {
      revision
      id
    }
  }
}

query GetCapactImpl {
  queryImplementation(filter: {path: {regexp: "/cap.implementation.capact.*/"}}) {
    path
    prefix
    name
    revisions {
      revision
      id
    }
  }
}

query GetAtlassianJiraInstallImpl {
  getImplementation(path: "cap.implementation.atlassian.jira.install") {
    name
    prefix
    path
    revisions {
      interfaces {
        id
        metadata {
          name
          path
        }
      }
      id
      metadata {
        name
      }
      revision
    }
    latestRevision {
      id
      metadata {
        id
        name
      }
    }
  }
}
","operationName":"GetAtlassianJiraInstallImpl"}

{"query":"query InterfaceGroup {
  queryInterfaceGroup {
    metadata {
      name
      description
      iconURL
    }
    interfaces {
      path
      latestRevision {
        revision
        metadata {
          name
          displayName
          description
        }
        spec {
          input {
            parameters {
              jsonSchema
            }
          }
        }
        implementations {
          latestRevision {
            revision
            metadata {
              path
            }
          }
        }
      }
    }
  }
}
","operationName":"InterfaceGroup"}
